class CitationBase {
  token;
  index;
  spanStart;
  spanEnd;
  fullSpanStart;
  fullSpanEnd;
  groups = {};
  metadata;
  document;
  constructor(token, index, metadata, spanStart, spanEnd, fullSpanStart, fullSpanEnd) {
    this.token = token;
    this.index = index;
    this.spanStart = spanStart;
    this.spanEnd = spanEnd;
    this.fullSpanStart = fullSpanStart;
    this.fullSpanEnd = fullSpanEnd;
    this.groups = token.groups || {};
    this.metadata = new Metadata(metadata);
    if (this.groups.page && /^_+$/.test(this.groups.page)) {
      this.groups.page = null;
    }
  }
  toString() {
    const parts = [`${this.constructor.name}("${this.matchedText()}"`];
    if (Object.keys(this.groups).length > 0) {
      parts.push(`, groups=${JSON.stringify(this.groups)}`);
    }
    parts.push(`, metadata=${JSON.stringify(this.metadata)}`);
    parts.push(")");
    return parts.join("");
  }
  correctedCitation() {
    return this.matchedText();
  }
  correctedCitationFull() {
    return this.matchedText();
  }
  dump() {
    return {
      groups: this.groups,
      metadata: Object.fromEntries(Object.entries(this.metadata).filter(([_, v]) => v !== undefined))
    };
  }
  matchedText() {
    return this.token.toString();
  }
  span() {
    return {
      start: this.spanStart ?? this.token.start,
      end: this.spanEnd ?? this.token.end
    };
  }
  spanWithPincite() {
    const starts = [this.metadata.pinCiteSpanStart, this.spanStart, this.token.start].filter((v) => v !== undefined);
    const ends = [this.metadata.pinCiteSpanEnd, this.token.end, this.spanEnd].filter((v) => v !== undefined);
    return {
      start: Math.min(...starts, this.token.start),
      end: Math.max(...ends, this.token.end)
    };
  }
  fullSpan() {
    return {
      start: this.fullSpanStart ?? this.span().start,
      end: this.fullSpanEnd ?? this.span().end
    };
  }
}

class Metadata {
  parenthetical;
  pinCite;
  pinCiteSpanStart;
  pinCiteSpanEnd;
  year;
  month;
  day;
  court;
  plaintiff;
  defendant;
  extra;
  antecedentGuess;
  resolvedCaseNameShort;
  resolvedCaseName;
  publisher;
  volume;
  constructor(data) {
    if (data) {
      Object.assign(this, data);
    }
  }
}

class Token {
  data;
  start;
  end;
  groups = {};
  constructor(data, start, end, groups = {}) {
    this.data = data;
    this.start = start;
    this.end = end;
    this.groups = groups;
  }
  toString() {
    return this.data;
  }
  merge(other) {
    if (this.start === other.start && this.end === other.end && this.constructor === other.constructor && JSON.stringify(this.groups) === JSON.stringify(other.groups)) {
      return this;
    }
    return null;
  }
  static fromMatch(match, extra, offset = 0) {
    const captureIndex = match.length > 1 && match[1] !== undefined ? 1 : 0;
    const matchText = match[captureIndex];
    let start = (match.index || 0) + offset;
    if (captureIndex > 0 && match[0]) {
      const captureOffset = match[0].indexOf(match[captureIndex]);
      if (captureOffset > 0) {
        start += captureOffset;
      }
    }
    const end = start + matchText.length;
    const groups = {};
    if (match.groups) {
      Object.assign(groups, match.groups);
    }
    return new this(matchText, start, end, groups, extra);
  }
}

class Resource {
  citation;
  constructor(citation) {
    this.citation = citation;
  }
  toString() {
    return `Resource(${this.citation.toString()})`;
  }
}
