function bisectRight(arr, val) {
  let left = 0;
  let right = arr.length;
  while (left < right) {
    const mid = Math.floor((left + right) / 2);
    if (arr[mid] <= val) {
      left = mid + 1;
    } else {
      right = mid;
    }
  }
  return left;
}
